import React, { Component } from 'react';

class Dog extends Component {
  constructor(props) {
    super(props)

    this.state = {
      imageDog: '',
      galleryDog: [],
      loading: false,
    }
  }

  componentDidMount() {
    this.fetchDog();
  }

  render() {
    return(
      <div>
        <h1>
          Galeria de cães
        </h1>
        { this.state.imageDog }
        <button onClick={ this.fetchDog }>Adicionar nova imagem</button>
      </div>  
    );
  }
}

export default Dog;
